import "./App.css";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import Home from "./components/home.components";
import Nav from "./components/nav.component";

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Nav />
        <div className="auth-wrapper">
          <div className="auth-inner">
            <Home />
          </div>
        </div>
      </div>
    </BrowserRouter>
  );
}

export default App;
